scripts.fetchUserProfile:
function(accessToken, ctx, cb) {
  request.get('https://ab-test.grean.id/oauth2/userinfo', {
    headers: {
      'Authorization': 'Bearer ' + accessToken
    }
  }, function(e, r, b) {
    if (e) return cb(e);
    if (r.statusCode !== 200) return cb(new Error('StatusCode: ' + r.statusCode));
    var profile = JSON.parse(b);
    //profile.user_id = profile.nameidentifier;
    profile.user_id = profile.pidNumberIdentifier;
    cb(null, profile);
  });
}
